import React from "react";
import { Menu } from "antd";
import { NavLink } from "react-router-dom";

export const NavBar = () => {
  return (
    <Menu type="horizontal">
      <Menu.Item>
        <NavLink to="/home">Home</NavLink>
      </Menu.Item>
      <Menu.Item>
        <NavLink to="/link">Links</NavLink>
      </Menu.Item>
      <Menu.Item>
        <NavLink to="/">Выход</NavLink>
      </Menu.Item>
    </Menu>
  );
};
